import React, { Component,Fragment } from 'react';

export class GrandPrixCounter extends Component {
  render() {
    return (
      <Fragment>
        <p>689,562</p>
        <p>Grand Prixs this week</p>
      </Fragment>
    )
  }
}

export default GrandPrixCounter;
